import React, {useState} from 'react'

export default function Hooks() {
    const[message,setmsg]=useState("Hello........")

 const MsgHandler=()=>{
        setmsg("Hi......")
    }
  
    return (
    <>
    <p>{message}</p>
    <button onClick={MsgHandler}>Click me</button>
    </>
  )
}
